// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Healthcare {
    
    struct Patient {
        string name;
        uint age;
        string email;
        string patientId;
        address wallet;
    }

    mapping(address => Patient) public patients;
    mapping(string => address) public patientIdToAddress;

    event PatientRegistered(
        address indexed wallet,
        string name,
        string email,
        string patientId
    );

    /// @notice Register a new patient
    /// @param name Full name of the patient
    /// @param age Age of the patient
    /// @param email Email address
    /// @param patientId Unique alphanumeric ID
    function registerPatient(
        string memory name,
        uint age,
        string memory email,
        string memory patientId
    ) public {
        require(bytes(name).length > 0, "Name is required");
        require(age > 0, "Invalid age");
        require(bytes(email).length > 0, "Email is required");
        require(bytes(patientId).length > 0, "Patient ID is required");
        require(patientIdToAddress[patientId] == address(0), "Patient ID already used");
        require(bytes(patients[msg.sender].name).length == 0, "Patient already registered");

        Patient memory newPatient = Patient({
            name: name,
            age: age,
            email: email,
            patientId: patientId,
            wallet: msg.sender
        });

        patients[msg.sender] = newPatient;
        patientIdToAddress[patientId] = msg.sender;

        emit PatientRegistered(msg.sender, name, email, patientId);
    }

    /// @notice Get patient details by wallet
    function getPatient(address patientAddr) public view returns (
        string memory name,
        uint age,
        string memory email,
        string memory patientId,
        address wallet
    ) {
        Patient memory p = patients[patientAddr];
        return (p.name, p.age, p.email, p.patientId, p.wallet);
    }

    /// @notice Get patient details by patientId
    function getPatientById(string memory patientId) public view returns (
        string memory name,
        uint age,
        string memory email,
        address wallet
    ) {
        address patientAddr = patientIdToAddress[patientId];
        Patient memory p = patients[patientAddr];
        return (p.name, p.age, p.email, p.wallet);
    }
}
